import React, { Component } from 'react';
import { connect } from "react-redux";
class Profile extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
              <h1>Welcome to the Profile { this.props.match.params.id }</h1>
            </div>
        )
    }
}

export default Profile;
